The Party's Over (2001) [aka Last Party 2000] documentary AVI


The Party's Over follows Philip Seymour Hoffman as a concerned citizen on an uncensored journey of the state of democracy in America. The film examines how the American political process addresses, and often fails to address, the country's most pressing issues. As we countdown to the pivotal &gt;2012&lt; election, the film answers the question, is there a difference between Republicans and Democrats? In the film Philip Seymour Hoffman interviews Tim Robbins, Susan Sarandon, Jesse Jackson, Rudy Giuliani, Michael Moore, and Bill Maher.


